import './../App.css';
import {Link} from "react-router-dom";

function Login() {


    return (
        <div className="App">
            <header className="App-header">
                <h2>Press button to Log in</h2>
                <button className='Button-style'>
                    <Link to='/' className='Button-style' style={{textDecoration: 'none'}}>
                        Log in
                    </Link>
                </button>
            </header>
        </div>
    );
}

export default Login;
